import React, { useEffect, useState } from "react";
import { useLocation, useNavigate, useParams } from "react-router-dom";
import { orderAPI } from "../services/api";


const OrderDetails = () => {
  const navigate = useNavigate();
  const { state } = useLocation();
  const { id } = useParams();

  const [order, setOrder] = useState(state?.order || null);
  const [loading, setLoading] = useState(!state?.order);
  const [error, setError] = useState(null);

  useEffect(() => {
    if (order) return;

    if (!id) return;

    const fetchOrder = async () => {
      try {
        setLoading(true);
        const res = await orderAPI.getOrderDetails(id);
        setOrder(res.data);
      } catch (err) {
        console.error(err);
        setError("Failed to load order details");
      } finally {
        setLoading(false);
      }
    };

    fetchOrder();

  }, [id]);

  if (loading) {
    return <div className="od-loading">Loading order...</div>;
  }

  if (error || !order) {
    return (
      <div className="od-error">
        <h2>‚ö† Error loading order</h2>
        <p>{error}</p>
        <button onClick={() => navigate(-1)}>Go Back</button>
      </div>
    );
  }

  const orderId = order.orderId ?? order.id;

  return (
    <div className="od-container">
      <div className="od-card">

        <h1 className="od-title">üßæ Order #{orderId}</h1>

        <div className="od-info">
          <p><b>Date:</b> {new Date(order.createdAt).toLocaleString()}</p>
          <p><b>Retailer:</b> {order.retailerName}</p>
          <p><b>Farmer:</b> Farmer #{order.farmerId}</p>
          <p><b>Payment Method:</b> {order.paymentMethod}</p>
          <p><b>Payment Status:</b> 
            <span className={`od-status ${order.paymentStatus === "PAID" ? "paid" : "pending"}`}>
              {order.paymentStatus}
            </span>
          </p>
        </div>

        <h2 className="od-subtitle">üõí Products</h2>

        <table className="od-table">
          <thead>
            <tr>
              <th>Product</th>
              <th>Qty</th>
              <th>Price</th>
              <th>Total</th>
            </tr>
          </thead>

          <tbody>
            {order.items?.map((item, idx) => (
              <tr key={idx}>
                <td>{item.productName}</td>
                <td>{item.quantity}</td>
                <td>‚Çπ{item.price}</td>
                <td>‚Çπ{item.total}</td>
              </tr>
            ))}
          </tbody>
        </table>

        <h2 className="od-total">
          üí∞ Total Amount: <span>‚Çπ{order.totalAmount}</span>
        </h2>

        <button className="od-back-btn" onClick={() => navigate(-1)}>
          ‚Üê Back
        </button>
      </div>
    </div>
  );
};

export default OrderDetails;
